{"source":{"uri":"features/catalogo.feature","data":"#language: pt\n\nFuncionalidade: Catalogo de cafe\n    Como um usuario do site, eu quero ver o catalogo de cafes na pagina principal\n    Para que eu popssa escolher e saber mais sobre os produtos disponíveis\n\nCenario: Acessar o catalogo de cafes na pagina principal\n\n    Quando acesso a pagina proncipal da Starbugs\n    Entao eu devo ver uma lista de cafes disponíveis\n\nCenario: Iniciar a compra de um cafe\n\n    Dado que estou na pagina principal da Starbugs\n        E que desejo comprar o seguinte produto:\n        | name     | Expresso Gelado |\n        | price    | R$ 9,99         |\n        | delivery | R$ 10,00        |\n    Quando inicio a compra desse item\n    Entao devo ver a pagina de Checkout com os detalhe do produto\n        E o valor total da compra deve ser de \"R$ 19,99\"\n\nCenario: Cafe indisponivel\n\n    Dado que estou na pagina principal da Starbugs\n        E que desejo comprar o seguinte produto:\n        | name     | Expresso Cremoso |\n    Quando inicio a compra desse item\n    Entao devo ver um popup informando que o produto esta indisponível","mediaType":"text/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features/pedido.feature","data":"#language:pt\n\nFuncionalidade: Pedidos\n\n    Como um usuario do site Starbugs, eu quero selecioanr e comprar cafes\n    Para que eu possa receber os produtos em meu endereco e efetuar o pagamento na entrega\n\n    Cenario: Compra bem sucedida\n\n        Dado que estou na pagina principal da Starbugs\n            E que iniciei a compra do item \"Expresso Tradicional\"\n        Quando faco a busca do seguinte CEP: \"04534011\"\n            E informo os demais dados do endereco:\n                | Number      | 1000    |\n                | Details     | Apto 22 |\n            E escolho a forma de pagamennto \"Cartão de Débito\"\n            E por fim finalizo a compra\n\n        Entao sou redirecionado para a pagina de confirmacao de Pedidos\n            E deve ser informado oseguinte prazo e entrega: \"20 min - 30 min\"","mediaType":"text/x.cucumber.gherkin+plain"}},
